import logo from './logo.svg';
import './App.css';
import Typical from 'react-typical'

function App() {
  return (
    <div className="App">
      <h3>Hi, I'm Summer Bakr.</h3>
      <h2>I'm a </h2>
    <Typical
        steps={['budding software developer', 1000, 'avid learner', 1000, "dedicated and passionate individual", 1000]}
        loop={Infinity}
        wrapper="p"
      />
    </div>
  );
}

export default App;
